		    for (var i = 0; i < indices.length; i++) {
		        objeto.faces.push( new THREE.Face3( (indices[i][0] -1) , (indices[i][1] -1), (indices[i][2] -1) ) );
		        
		    }

		    objeto.computeBoundingSphere();
		    for (var i = 0; i < indices.length; i++) {
		        
		        verticesFinal[(i * 9) + 0] = verticesMesh[(indices[i][0]) - 1][0];
		        verticesFinal[(i * 9) + 1] = verticesMesh[(indices[i][0]) - 1][1];
		        verticesFinal[(i * 9) + 2] = verticesMesh[(indices[i][0]) - 1][2];
		        verticesFinal[(i * 9) + 3] = verticesMesh[(indices[i][1]) - 1][0];
		        verticesFinal[(i * 9) + 4] = verticesMesh[(indices[i][1]) - 1][1];
		        verticesFinal[(i * 9) + 5] = verticesMesh[(indices[i][1]) - 1][2];
		        verticesFinal[(i * 9) + 6] = verticesMesh[(indices[i][2]) - 1][0];
		        verticesFinal[(i * 9) + 7] = verticesMesh[(indices[i][2]) - 1][1];
		        verticesFinal[(i * 9) + 8] = verticesMesh[(indices[i][2]) - 1][2];
		    }


		    // itemSize = 3 because there are 3 values (components) per vertex

		    geometry.addAttribute('position', new THREE.BufferAttribute(verticesFinal, 3));
		    geometry.computeFaceNormals();
		    geometry.computeVertexNormals();
		    THREE.GeometryUtils.center(geometry);
		    var material = new THREE.MeshPhongMaterial({
		        color: 0xd3d3d3,
		        shininess: 50
		    });
		    var mesh = new THREE.Mesh(geometry,material);
            
		    var objeto2 = new THREE.Mesh(objeto, material);
            
		    scene.add(mesh);

		    var light = new THREE.PointLight();
		    light.position.set(50, 150, 150);
		    scene.add(light);



		    camera.position.z = 700;
		    
		    var screenW = window.innerWidth;
		    var screenH = window.innerHeight; /*SCREEN*/
		    var spdx = 0, spdy = 0; mouseX = 0, mouseY = 0, mouseDown = false; /*MOUSE*/


		    document.addEventListener('mousemove', function (event) {
		        mouseX = event.clientX;
		        mouseY = event.clientY;
		    }, false);
		    document.body.addEventListener("mousedown", function (event) {
		        mouseDown = true
		    }, false);
		    document.body.addEventListener("mouseup", function (event) {
		        mouseDown = false
		    }, false);
		    


		    document.body.addEventListener('touchstart', function (e) {
		        e.preventDefault()
		        mouseDown = true;
		    }, false)

		    document.body.addEventListener('touchmove', function (e) {
		        var touchobj = e.changedTouches[0] // reference first touch point (ie: first finger)
		        mouseX = parseInt(touchobj.clientX) // get x position of touch point relative to left edge of browser
		        mouseY = parseInt(touchobj.clientY)
		        e.preventDefault()
		    }, false)

		    document.body.addEventListener('touchend', function (e) {
		        e.preventDefault()
		        mouseDown = false;
		    }, false)


		    var render = function () {
		        requestAnimationFrame(render);

		        spdy = (screenH / 2 - mouseY) / 80;
		        spdx = (screenW / 2 - mouseX) / 80;
		        if (mouseDown) {
		            mesh.rotation.x = spdy;
		            mesh.rotation.y = spdx;
		        }
		        renderer.render(scene, camera);
		    };

		    render();
		</script>
	</body>
</html>
